import React, { useEffect, useState } from 'react';

const StationsList = ({ titulo, url }) => {

    const [station, setStation] = useState([]);


    useEffect(() => {
        console.log(station);
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch(url);
        const stations = await data.json();
        setStation(stations.ListaEESSPrecio);
    }

    return (
        <div>
            <h2>{titulo}</h2>
        <div className='row'>
            {station.map((item,index) => (
                <div key={index} className='col'>
                    <div className='card' style={{width: '2oopx'}}>
                        <img src="https://easygasgroup.com/wp-content/uploads/2020/02/A_opt.jpg" alt="gasolinera" style={{height: '200px'}}/>
                        <div className='card-body'>
                            <h6 className='card-title'>{item['Rótulo']}</h6>
                            <hr />
                            <p>Localidad: {item.Localidad}</p>
                            <p className='.text-uppercase'>Dirección: {item['Dirección']} </p>
                            <p>Precio Gásolina 95: {item['Precio Gasolina 95 E5']} € </p>
                            <p>Precio Gasolina 98: {item['Precio Gasolina 98 E5']} € </p>
                            <p>Precio Gasóleo: {item['Precio Gasoleo A']} € </p>
                        </div>
                    </div>
                </div>
            ))}
        </div>
        </div>
    );
}

export default StationsList;

